 function Main() {
  const [isLoaded, setIsLoaded] = useState(false);

  useEffect(() => {
    const timer = setTimeout(() => {
      setIsLoaded(true);
    }, 1000);

    return () => clearTimeout(timer);
  }, []);

  return (
    <div>
      {isLoaded ? <App /> : <SplashScreen />}
    </div>
  );
}  

 function AppWrapper() {
  return (

      <Main />

  );
} 

export default AppWrapper;
